INSERT INTO `wallpaper_subject` VALUES (29, '黑执事', '【COS正片】夏尔中华风<br>虽然现在还不知道啵酱的名字，但是还是先叫夏尔吧<br><br>夏尔 cn 君寻（原po）<br>妆面 cn 橘子<br>摄影 cn 尘鸢<br>后期 cn 白夜@白夜-w <br>后勤 cn 凉曦@凉曦大王 <br><br>天气预报是骗人的，那天的那个时段明明显示的是多云，结果下雨了，还约下越大，不想嗦发，冬天外景真的冷到全身僵硬，真的辛苦后勤和摄影这么冷的天还陪我出来，辛苦白夜疯狂肝图！！！还有我大宝贝早起给我化妆！！！辛苦为这套片出力的每一个人！！！！【眼罩另一条带子在头发外面是因为我想把眼罩后面绑的结漏出来，结果藏不进去头发里面索性就那样带着了】', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/29/e727d488166a8cae5c093a4b9ebfb6fa25fe7cc3.jpg', 1, '黑执事', '2019-04-19 02:33:23.380155', 0, '6679957540559651083', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/29/f5f17587f115568fff2e3baae20582ce2771f521.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/29/3daeef624a3d28a5ae42711252b5f512e301c60b.jpg');
