INSERT INTO `wallpaper_subject` VALUES (176, '奇迹暖暖', '长明<br><br>记幽冥仙主<br><br>cn：清镜清影<br>文案：清镜清影（结合个人脑洞，不喜勿喷）<br><br>古人云，以鲛人脂为灯，烛火长明不灭，墓中人千年不朽。<br><br>我也不知道自己叫什么名字，来自何方。游府的大小姐，亦或是酆都的长公主？不重要了，都不重要了。<br><br>白氏之女应当早已代替我，成为新一任的幽冥仙主了罢。回忆如潮水涌来，眼前仿佛还是她微笑着伸出的手，指尖嫣红的蔻丹灼灼妖冶，像极了淋漓的鲜血。不知这样无穷无尽的杀戮，她会不会后悔，我突然有些好笑，取而代之的，是深深的疲惫。<br><br>“既是你所愿，那成全你便是。”<br><br>银针划过，从此之后，再无游诗。<br><br>又一次陷入沉睡，如今醒来，已是百年。<br><br>墓碑冰冷，寒棺幽暗，摸索着墓志铭上凹凸不平的字迹，像极了当年，我亲手送故友到墓道尽头，只是没想到，这一次下葬的，成了自己。<br><br>还记得当初的那个她，焚躯煅骨，炼魂为烛，求我携她入地宫，伴那人长眠。我不解，身为鲛人族女，本应长生不老，却宁可叛国杀身，不入轮回，只为护一人不朽，免他受我冥府炼狱之苦，又何必呢。<br><br>可是很多年后，我恍惚觉得，也许只是因为，我这个受到诅咒的酆都公主，永生永世，都不配沾染红尘。<br><br>可笑至极。我在忘川的舟楫中，渡魂，渡命，却独独渡不了情。我如是，历代的幽冥仙主，无一不如是。<br><br>所以，我倦了。<br><br>最可怕的，并非护不住自己毕生所爱，而是根本不知，情爱为何物。<br><br>我这一生，所有曾相伴的，都已化作尘埃，同葬墓中。傀儡娃娃，针线，还有，那个她。<br><br>君埋泉下泥销骨，我寄人间雪满头。', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/176/96be5fa16dad4ef22308546e63c0c8e810ae89ec.jpg', 1, '奇迹暖暖', '2019-05-20 10:39:12.263581', 0, '6691604193511211268', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/176/d81ec033b9d369d5694ea4ee66eb697d6a6acddd.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/176/f6826507c750792001100dbfc5ec53af93cf4ad0.jpg');
