INSERT INTO `wallpaper_subject` VALUES (740, '少年锦衣卫', '#cos正片<br>#少年锦衣卫#九公主朱延婍#民间#<br><br><br>“四海为家，总好过每天对着你们几个吧。”<br><br><br><br>“我还在长身体啊，吃多一点怎么了？”<br><br>“段大哥！阿九想吃冰糖葫芦！”<br><br>“原来宫里飘出来的河灯，最后都会到这里，归宿也在这里啊。”<br><br>出镜：执仪（po）<br>妆造后摄：锦色姐姐<br>后勤：瑶瑶 <br>服装：悠窝窝<br><br>—————————<br><br>等了好久好久的小九终于在今天正式和大家见面了！超级开心！<br>距离我不出萝莉不知道过去多长时间了，突然看到小九有那么点儿惊讶，原来我也这么可可爱爱过。<br>反季节斗士执老板终于上线了&#091;em&#093;e401095&#091;/em&#093;<br>这套片子要感谢的人太多了，是我拍的第一次正片，2月18号顶着东北零下二十多度的温度，锦色姐说跟我一起出去外景就去外景了，瑶瑶一个女孩子又当爹又当妈给我举灯还给我拎东西，真的真的超级感动<br>想起来当时拍的小视频，某些coser表面光鲜亮丽，实际上背后已经冻得不行了，就很想笑，那天真的超级冷，我整个人都在打颤，本来想第二天去展子把买了的兔头分给可爱列表，结果我第二天就发烧阵亡了，兔头全我一个人吃了哈哈哈哈哈哈哈<br>这个真的是我想要的阿九了，再一次感谢为这套片子付出的所有人！！！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/740/1cc2edff7ddcea5569eac2a1130d0c0d5c794682.jpg', 1, '少年锦衣卫', '2019-07-07 19:00:24.693363', 0, '6709475540018921741', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/740/61d6aab98cf7b6a92c0caa258d56fd89802cef11.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/740/86f29589ced5e60cc640eb846f22e9ffc4361a73.jpg');
