INSERT INTO `wallpaper_subject` VALUES (919, '第五人格', '理想乡d2场照<br>约瑟夫@就我与你 <br>驱魔人:原po<br>那个庄园曾经金碧辉煌，过去你我放荡不羁。<br>现如今草木凋朽，我一直在追寻着你的脚步，一步一步，从不曾离去。<br>我走过很多地方，去过镜像里的往昔，留在现实里的腐朽，当镜像与现实重叠，我还是未能再次见到你的面容。<br>恍惚之间，我又站在了大门前，鸣笛声响，古老的铁门缓缓打开，你就站在那里，背对着我。<br>“我知道他不会再回来了。”<br><br>——————————————————<br><br>当那个庄园还是一片繁华之时，我在舞会上初见你那动人的脸庞，你微微侧目，转瞬间景象幻变，一眼定情。<br><br>我在云冻水凝的日子里见证着游乐园的落寞，所有都不复以往，可我依然在这里等候。<br><br>走到某处时，我像是察觉到了什么，愕然回头——<br><br>那里没有你的身影。<br><br>“一切都结束了”<br>——————————————', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/919/211fcd5380b73394570a3c931914eb79ef827bad.jpg', 1, '第五人格', '2019-07-16 02:48:34.233978', 0, '6711068462015316238', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/919/34430f4a98bfeebf78445b84a5845f387f0c00f3.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/919/64e99d052fe2458b94050148ddd728b7c71fa774.jpg');
