INSERT INTO `wallpaper_subject` VALUES (3024, '天涯明月刀OL', '【cos正片/瑶音】天涯明月刀x故宫联动——方寸·云中三希堂<br>怀抱观古今，深心托豪素<br>三希堂，为清高宗珍藏历代法书真迹之所，其中以王羲之《快雪时晴帖》、王献之《中秋帖》、王珣《伯远帖》三帖尤为珍贵，故名三希堂 。<br>coser：瑶音<br>摄影/后期/策划/场景搭建：哲哲<br>协力：黑歪歪<br>排版：橙子水<br>服装：汐风半夏<br>出处：天涯明月刀×故宫联动时装——方寸·云中三希堂<br> <br>创作理念：三希堂是收藏各类名家书法之所，尤其以三帖最为珍贵，所以我们在创作这套片子的时候一共选择了三个阶段：<br>长图1：这是一个正在收集各类书法作品的拟人化情景，将书法作品收集在一起，慢慢的人也跟着一起融入到这些作品中<br>长图2：是各类书法字体的拟人化，有狂草，行，楷，隶等，各种字体在卷帛上的动态<br>长图3：当作品完成后进入装裱的过程，一副一幅完成好的字帖，最终装裱完成收录<br> <br>这套片子是我们的一套心血片，谢谢大家一直看到这里，这里面倾注了大家各种脑洞心血和情感，我本人也是从小学习书法的，对书法作品非常的喜爱，而这次可以出以书法作品为拟人的片子，真的很喜欢很喜欢。也感谢所有为这套片子付出的小伙伴，希望大家能够喜欢这套三希堂！爱你们！', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/3024/f69edac372b7becfc7e3e1db6a72ffc615967e89.jpg', 1, '', '2019-11-16 19:02:26.097550', 0, '6758632842919411972', 'bcy', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/3024/f467d8b14695ee2b2c095e4e129e16aa0c1d9ece.jpg', 'https://wallpager-1251812446.cos.ap-beijing.myqcloud.com/image/3024/a88bbdf4987ec4bd357bceb12cb15f57a8320878.jpg');
